INSERT INTO `pages` (`id`, `title`, `text`, `active`) VALUES
(12, 'Клиентам', '<p>Заказать у нас авто невероятно просто. Прежде всего, просмотрите с Вашей “второй половинкой” наш обширный каталог свадебных автомобилей и выберите интересующий вас вариант.\r\n</p><p>Затем оформите онлайн-заявку, заполнив все необходимые поля. <br>Получив заявку, водитель отправит вам подтверждение брони на вашу дату. Следующий шаг – внесение необходимой суммы предоплаты.\r\n</p><p>И, наконец, в день свадьбы вы получаете именно тот автомобиль, в котором вы мечтали приехать на самый яркий праздник Вашей жизни.</p><p>С помощью сервиса Weddingcars вы можете составить целый свадебный кортеж. А также проследить за тем, чтобы он был выдержан в едином стиле, из автомобилей одной марки и цвета.\r\n</p>', 0);
